import{j as e,o,c as a,k as n}from"./app.2b3f3d52.js";const i={class:"prose prose-sm m-auto text-left"},r=n('<p><a href="/about">\u4E2D\u6587</a> | English</p><p>The Software Association of South China Normal University (SoCoding) is a free academic organization oriented to technology and interest, formed by the software and hardware technology enthusiasts among the students of South China Normal University on their own initiative, under the leadership of the Party Committee of the University and the guidance of the University Youth League Committee and the School of Software.</p><p>The purpose of Software Association is</p><ul><li>To serve the students and teachers at school as the fundamental, to give back to the open source community as the vision, and to contribute to the development of the open source cause.</li><li>To focus on cutting-edge computer hardware and software and Internet-related industries, explore related technologies, and export content.</li><li>To create an excellent academic atmosphere for computer software and hardware, and to provide a platform for enthusiasts to communicate and learn.</li></ul><p>We look forward to getting to know you, learning cutting-edge technologies and growing together. Welcome you to join us.</p><p><a href="/bylaws">Articles of association By-laws</a></p>',6),s=[r],p={title:"About | SCNU SoCoding",meta:[{property:"og:title",content:"About | SCNU SoCoding"}]},m={__name:"about",setup(c,{expose:t}){return e({title:"About | SCNU SoCoding",meta:[{property:"og:title",content:"About | SCNU SoCoding"}]}),t({frontmatter:{title:"About | SCNU SoCoding",meta:[{property:"og:title",content:"About | SCNU SoCoding"}]}}),(h,l)=>(o(),a("div",i,s))}};export{m as default,p as frontmatter};
